    [],nt"num_tags": 0,nt"name": "environmental-sensitivity-index-esi-atlas-guam-2005-maps-and-geographic-information-systems-da",nt"isopen":
    false,nt"url": null,nt"notes": "The most widely used approach to sensitive
    environment mapping in the U.S. is NOAA's Environmental Sensitivity Index (ESI).
    This approach systematically complies information in standard formats for coastal
    shoreline sensitivity, biological resources, and human-use resources. ESI maps are
    useful for identifying sensitive resources before a spill occurs so that protection
    priorities can be established and cleanup strategies designed in advance. Using
    ESIs in spill response and planning reduces the environmental consequences of the
    spill and cleanup efforts.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
